import React, { useState, useEffect } from 'react';
import { Link } from 'react-router-dom';
import APIInvoke from '../../utils/APIInvoke'


const CrearLogin = () => {

    const [usuario, setusuario] = useState({
        nombre: 'RICARDO GUTIERREZ',
        email: "g@gmail.com",
        contrasena: '',
        confirmar: '',
      //tipoDocumento: '',
        numDocumento: '',
        tipoUsuario: '',
      //  telefono: '',
      //  departamento: '',
      //  ciudad: '',
      //  direccion: '',
      //  estadoUsuario: 'ACTIVO',
    });
      
    const {email,contrasena, confirmar, nombre, tipoDocumento, numDocumento, tipoUsuario, telefono, departamento, ciudad, direccion, estadoUsuario} = usuario;

 
    const onChange = (e) => {
        setusuario ({
            ...usuario,
            [e.target.name]: e.target.value
        })
            
        
    }
    
    useEffect ( () => {
        document.getElementById("name").focus();

    }, [])

    const crearCuenta = async () => {
          

    }
     
    const crear = (e) => {
        e.preventDefault();
        crearCuenta();

    }

    return (
        <div class='hold-transition login-page'>

            <div className="login-box">
                <div className="login-logo">
                    <Link to="#"><b>MiDulceOnline</b></Link>
                </div>
                {/* /.login-logo */}
                <div className="card">

                    <div className="card-body login-card-body">
                        <p className="login-box-msg">Iniciar Sesion</p>
                        
                        <form onSubmit={crear}>

                        <div className="input-group mb-3">
                                <input type="text"
                                    className="form-control"
                                    placeholder="Nombre Completo"
                                    id="nombre"
                                    name="nombre" 
                                    value={nombre}
                                    onChange={onChange}
                                    required

                                />

                                <div className="input-group-append">
                                    <div className="input-group-text">
                                        <span className="" />
                                    </div>
                                </div>
                            </div>

                            <div className="input-group mb-3">
                                <input type="email"
                                    className="form-control"
                                    placeholder="Email"
                                    id="email"
                                    name="email"
                                    value={email}
                                    onChange={onChange}
                                    required
                                 />

                                <div className="input-group-append">
                                    <div className="input-group-text">
                                        <span className="fas fa-envelope" />
                                    </div>
                                </div>
                            </div>

                            <div className="input-group mb-3">
                                <input type="password"
                                    className="form-control"
                                    placeholder="Contraseña"
                                    id="contrasena"
                                    name="contrasena"
                                    value={contrasena}
                                    onChange={onChange}
                                    required
                                 />
                                <div className="input-group-append">
                                    <div className="input-group-text">
                                        <span className="fas fa-lock" />
                                    </div>
                                </div>
                            </div>

                            <div className="input-group mb-3">
                                <input type="password"
                                    className="form-control"
                                    placeholder="Confirmar Contraseña"
                                    id="confirmar"
                                    name="confirmar"
                                    value={confirmar}
                                    onChange={onChange}
                                    required
                                 />
                                <div className="input-group-append">
                                    <div className="input-group-text">
                                        <span className="fas fa-lock" />
                                    </div>
                                </div>
                            </div>
                            

                        
                            <div className="row">

                                <div className="col-6">
                                 <button type="submit" className="btn btn-primaryblock btn-primary">Crear Usuario </button>
                                </div>

                                <div className="col-6">
                                    <Link to="/" class="btn btn-block btn-primary">Regresar Login</Link>
                                </div>

                                {/* /.col */}
                            </div>

                        </form>



                    </div>
                </div>
            </div>
        </div >
    )

};

export default CrearLogin;
